	Auth0Lock.prototype._setEmail = function(email) {
	  var email_input = this.query('input[name=email]');
	  if (email_input && email_input.length === 1) {
	    email_input.val(email);
	    bean.fire(email_input[0], 'input');
	  }
	};
	
